import javax.servlet.*;
import javax.servlet.http.*;
import javax.servlet.annotation.*;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

@WebServlet(name = "CustomerServlet", urlPatterns = "/customer")
public class CustomerServlet extends HttpServlet {
    static List<Customer> customerList = new ArrayList<>();

    static {
        customerList.add(new Customer("Mai Van Hoang", "1983-08-20", "Ha Noi", "data:image/jpeg;base64,"));
        customerList.add(new Customer("Nguyen Van Nam", "1983-08-21", "Bac Giang", "data:image/jpeg;base64,"));
        customerList.add(new Customer("Nguyen Thai Hoa ", "1983-08-22", "Nam Dinh", "data:image/jpeg;base64,"));
        customerList.add(new Customer("Tran Dang Khoa", "1983-08-17", "Ha Tay", "data:image/jpeg;base64,"));
        customerList.add(new Customer("Nguyen Dinh Thi", "1983-08-19", "Ha Noi", "data:image/jpeg;base64,"));
    }

    @Override
    protected void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
        request.setAttribute("customerList", customerList);
        request.getRequestDispatcher("customer.jsp").forward(request,response);
    }

    @Override
    protected void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {

    }
}
